import React from 'react';
import './App.css';
import Topbar from './Components/Topbar';
import Leftpane from './Components/Leftpane';
import Chatpane from './Components/Chatpane';
import { UserState } from './context/users/userState';
import { MessageContext } from './context/message/currentMessageState';

function App() {
  return (
    <div className="App">
      <UserState.Consumer>
        {UserStateValue => (
          <MessageContext.Consumer>
            {messageContextValue => (
              <div className="all">
                <Topbar UserStateValue={UserStateValue} />
                <div className="below-top">
                  <Leftpane UserStateValue={UserStateValue} />
                  <Chatpane
                    UserStateValue={UserStateValue}
                    messageContextValue={messageContextValue}
                  />
                </div>
              </div>
            )}
          </MessageContext.Consumer>
        )}
      </UserState.Consumer>
    </div>
  );
}

export default App;
